import React from "react";
import Chip from "@mui/material/Chip";
import Stack from "@mui/material/Stack";

const Shifter = (props) => {
  return (
    <Stack spacing={3}>
      <Chip>
        {props.time} - {props.employee}
      </Chip>
    </Stack>
  );
};

export default Shifter;
